import React from 'react';
import logo from '../assets/logo.png'; // Make sure the path to your logo image is correct;

const GrampsSection = () => {
  return (
    <section id="gramps" className="py-12 bg-gradient-to-r from-white to-black flex items-center justify-center">
      <div className="container mx-auto flex justify-center items-center">
        {/* Central container with padding */}
        <div className="flex justify-between items-center space-x-6 px-6 py-6 bg-transparent"> {/* Added padding and space between text and logo */}
          {/* Text container */}
          <div className="text-left"> 
            {/* Header */}
            <h2 className="text-4xl font-bold uppercase text-black mb-4 text-center">
              What does GRAMPS Mean?
            </h2>
            {/* Acronym spelled out */}
            <div className="text-3xl font-bold text-center">
              <div><span className="text-yellow-500">G</span><span className="text-gray-500">eriatric</span></div>
              <div><span className="text-yellow-500">R</span><span className="text-gray-500">esources</span></div>
              <div><span className="text-yellow-500">A</span><span className="text-gray-500">dvising</span></div>
              <div><span className="text-yellow-500">M</span><span className="text-gray-500">oving</span></div>
              <div><span className="text-yellow-500">P</span><span className="text-gray-500">lacement</span></div>
              <div><span className="text-yellow-500">S</span><span className="text-gray-500">ervices</span></div>
              <div><span className="text-gray-500">of Tennessee</span></div>
            </div>
          </div>
          {/* Logo */}
          <div> {/* Removed specific right padding to use space-x for spacing */}
            <img src={logo} alt="Your Logo" className="w-65 h-auto" />
          </div>
        </div>
      </div>
    </section>
  );
}

export default GrampsSection;
